INSERT INTO `news` (`news_id`, `news_title`, `news_quote`, `news_content`, `news_status`, `news_picture`, `news_category_id`) VALUES
(4, 'KAYLEE CÙNG MAI HỒ', '<p>Bạn c&oacute; sẵn s&agrave;ng cho cuộc dạo chơi với đ&ocirc;i sandal nhẹ t&ecirc;nh hay đ&ocirc;i b&uacute;p b&ecirc; dễ thương?&nbsp;</p>\r\n<p>Kaylee &amp; Mai Hồ muốn đem đến Bộ Sưu Tập với những đ&ocirc;i giầy nổi bật nhất cho m&ugrave;a h&egrave; n&agrave;y.</p>', '<p>&nbsp;</p>\r\n<p>Những đ&ocirc;i giầy sandal được phối d&acirc;y kho&aacute; nhẹ nh&agrave;ng nhưng tinh tế. Những đ&ocirc;i b&uacute;p b&ecirc; đơn giản v&agrave; mang lại sự &ecirc;m &aacute;i cho đ&ocirc;i ch&acirc;n.</p>\r\n<p>Với nhiều kiểu d&aacute;ng để lựa chọn, Kaylee c&ugrave;ng đội ngũ nh&acirc;n vi&ecirc;n chuy&ecirc;n nghiệp sẽ tư vấn cho c&aacute;c c&ocirc; n&agrave;ng c&oacute; được đ&ocirc;i giầy ph&ugrave; hợp nhất cho m&igrave;nh.</p>\r\n<p>Hệ thống cửa h&agrave;ng:&nbsp;<br /> Cửa h&agrave;ng 1: 407A L&ecirc; Văn Sỹ, P.12, Q.3&nbsp;<br /> Cửa h&agrave;ng 2: 250 Nguyễn Thị Thập, P.T&acirc;n Quy, Q.7</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"/pictures/content/Lookbook-MH-0123.png\" alt=\"\" width=\"350\" height=\"350\" />&nbsp; &nbsp; &nbsp;<img src=\"/pictures/content/Lookbook-MH-0145.png\" alt=\"\" width=\"350\" height=\"350\" /></p>\r\n<div class=\"text_exposed_show\">\r\n<p><img src=\"/pictures/content/Lookbook-MH-0246.png\" alt=\"\" width=\"350\" height=\"350\" />&nbsp; &nbsp; &nbsp;&nbsp;<img src=\"/pictures/content/Lookbook-MH-0279.png\" alt=\"\" width=\"350\" height=\"350\" /></p>\r\n<p><img src=\"/pictures/content/Lookbook-MH-0288.png\" alt=\"\" width=\"350\" height=\"350\" />&nbsp; &nbsp;&nbsp;<img src=\"/pictures/content/Lookbook-MH-0338.png\" alt=\"\" width=\"350\" height=\"350\" /></p>\r\n<p><img src=\"/pictures/content/Lookbook-MH-0389.png\" alt=\"\" width=\"350\" height=\"350\" />&nbsp; &nbsp; &nbsp;&nbsp;<img src=\"/pictures/content/Lookbook-MH-0439.png\" alt=\"\" width=\"350\" height=\"350\" /></p>\r\n<p><img src=\"/pictures/content/Lookbook-MH-0449.png\" alt=\"\" width=\"350\" height=\"350\" />&nbsp; &nbsp; &nbsp;<img src=\"/pictures/content/Lookbook-MH-0491.png\" alt=\"\" width=\"350\" height=\"350\" /></p>\r\n<p><img src=\"/pictures/content/Lookbook-MH-9751.png\" alt=\"\" width=\"350\" height=\"350\" />&nbsp; &nbsp; &nbsp;<img src=\"/pictures/content/Lookbook-MH-9771.png\" alt=\"\" width=\"350\" height=\"350\" /></p>\r\n<p><img src=\"/pictures/content/Lookbook-MH-9824.png\" alt=\"\" width=\"350\" height=\"350\" />&nbsp; &nbsp; &nbsp;<img src=\"/pictures/content/Lookbook-MH-9867.png\" alt=\"\" width=\"350\" height=\"350\" /></p>\r\n<p><img src=\"/pictures/content/Lookbook-MH-9912.png\" alt=\"\" width=\"350\" height=\"350\" />&nbsp; &nbsp; &nbsp;<img src=\"/pictures/content/Lookbook-MH-9930.png\" alt=\"\" width=\"350\" height=\"350\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>', 1, 'news_1500438332_Lookbook-MH-0449.png', 3),
(5, 'KAYLEE CÙNG MC LIÊU HÀ TRINH', '<p style=\"margin: 0px 0px 6px; font-family: Helvetica, Arial, sans-serif; color: #1d2129; font-size: 14px;\">Với mục đ&iacute;ch muốn đồng h&agrave;nh c&ugrave;ng c&aacute;c c&ocirc; n&agrave;ng Kaylee tr&ecirc;n mọi nẻo đường, Kaylee đ&atilde; cho ra đời những đ&ocirc;i giầy cao g&oacute;t với kiểu d&aacute;ng đa dạng.&nbsp;</p>\r\n<p style=\"margin: 0px 0px 6px; font-family: Helvetica, Arial, sans-serif; color: #1d2129; font-size: 14px;\">Kaylee gửi lời cảm ơn đến c&ocirc; bạn MC Li&ecirc;u H&agrave; Trinh c&ugrave;ng ekip đ&atilde; đồng h&agrave;nh c&ugrave;ng Kaylee thực hiện bộ ảnh n&agrave;y.</p>\r\n<p style=\"margin: 0px 0px 6px; font-family: Helvetica, Arial, sans-serif; color: #1d2129; font-size: 14px;\">&nbsp;</p>', '<p><span style=\"font-size: 12pt;\">Giầy cao g&oacute;t kh&ocirc;ng những c&oacute; thể mang lại vẻ đẹp b&ecirc;n ngo&agrave;i c&ograve;n thể hiện được c&aacute; t&iacute;nh của bản th&acirc;n người phụ nữ. Người th&igrave; th&iacute;ch những đ&ocirc;i giầy cao g&oacute;t c&oacute; đế thật chắc chắn để tạo sự tự tin cho từng bước ch&acirc;n. Người th&igrave; th&iacute;ch những đ&ocirc;i giầy cao g&oacute;t c&oacute; quai để thể hiện sự thanh mảnh thon thả của đ&ocirc;i ch&acirc;n.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Đến với Kaylee, ch&uacute;ng t&ocirc;i tin rằng&nbsp;<span class=\"text_exposed_show\">c&oacute; thể thoả m&atilde;n được c&aacute;c c&ocirc; g&aacute;i trong từng kiểu giầy.</span></span></p>\r\n<div class=\"text_exposed_show\">\r\n<p><span style=\"font-size: 12pt;\">MC Li&ecirc;u H&agrave; Trinh c&oacute; chia sẻ, giầy cao g&oacute;t l&agrave; kh&ocirc;ng thể thiếu trong c&ocirc;ng việc hằng ng&agrave;y. C&ocirc;ng việc cũng đ&ograve;i hỏi Trinh phải lu&ocirc;n thay đổi. Kaylee đ&atilde; phần n&agrave;o đ&aacute;p ứng được nhu cầu nho nhỏ của Trinh rồi đ&oacute;&nbsp;<span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v9/f5f/1.5/16/1f460.png\" alt=\"\" width=\"16\" height=\"16\" /></span></span></p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"/pictures/content/thumbs/2.jpg\" alt=\"\" width=\"310\" height=\"207\" />&nbsp;<img src=\"/pictures/content/thumbs/6.jpg\" alt=\"\" width=\"310\" height=\"207\" /></p>\r\n<p><img src=\"/pictures/content/thumbs/4.jpg\" alt=\"\" width=\"310\" height=\"207\" />&nbsp;<img src=\"/pictures/content/thumbs/7.jpg\" alt=\"\" width=\"310\" height=\"207\" /></p>\r\n<p><img src=\"/pictures/content/thumbs/19.jpg\" alt=\"\" width=\"310\" height=\"207\" />&nbsp;<img src=\"/pictures/content/thumbs/15.jpg\" alt=\"\" width=\"310\" height=\"207\" /></p>\r\n<p><img src=\"/pictures/content/thumbs/3.jpg\" alt=\"\" width=\"305\" height=\"204\" />&nbsp;&nbsp;<img src=\"/pictures/content/thumbs/8.jpg\" alt=\"\" width=\"305\" height=\"204\" /></p>\r\n<p><img src=\"/pictures/content/thumbs/9.jpg\" alt=\"\" width=\"305\" height=\"204\" />&nbsp;&nbsp;<img src=\"/pictures/content/thumbs/11.jpg\" alt=\"\" width=\"305\" height=\"204\" /></p>\r\n<p><img src=\"/pictures/content/thumbs/21.jpg\" alt=\"\" width=\"305\" height=\"204\" />&nbsp;&nbsp;<img src=\"/pictures/content/thumbs/23.jpg\" alt=\"\" width=\"305\" height=\"204\" /></p>\r\n<p><img src=\"/pictures/content/thumbs/24.jpg\" alt=\"\" width=\"305\" height=\"204\" />&nbsp;&nbsp;<img src=\"/pictures/content/thumbs/1.jpg\" alt=\"\" width=\"310\" height=\"207\" /></p>\r\n<p><img src=\"/pictures/content/thumbs/13.jpg\" alt=\"\" width=\"205\" height=\"307\" />&nbsp;<img src=\"/pictures/content/thumbs/14.jpg\" alt=\"\" width=\"205\" height=\"307\" />&nbsp;<img src=\"/pictures/content/thumbs/16.jpg\" alt=\"\" width=\"205\" height=\"307\" /></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src=\"/pictures/content/thumbs/17.jpg\" alt=\"\" width=\"205\" height=\"307\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"/pictures/content/thumbs/18.jpg\" alt=\"\" width=\"205\" height=\"307\" /></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"/pictures/content/thumbs/20.jpg\" alt=\"\" width=\"339\" height=\"226\" /></p>\r\n<p><img src=\"/pictures/content/thumbs/10.jpg\" alt=\"\" width=\"205\" height=\"307\" />&nbsp;<img src=\"/pictures/content/thumbs/12.jpg\" alt=\"\" width=\"205\" height=\"307\" />&nbsp;<img src=\"/pictures/content/thumbs/22.jpg\" alt=\"\" width=\"205\" height=\"307\" /></p>\r\n<p>&nbsp;</p>\r\n</div>', 1, 'news_1498910129_LIN_7325 copy.jpg', 3),
